import React, { Component } from 'react'
import { Fragment, useState } from 'react'
import dataCar from "../carsData/carsData.json";

import Box from '@mui/material/Box';
import Rating from '@mui/material/Rating';
import Typography from '@mui/material/Typography';

export class CarSignleAudi1 extends Component {






    render() {

        const [value, setValue] = useState(2);

        return (
            <Fragment>
                <div className="container mb-5 mt-5">
                    <div className="row">
                        <img className="col-lg-5" src={dataCar[0].img} alt={dataCar[0].name} />
                        <div className="col-lg-7">
                            <p>Model : {dataCar[0].Model}</p>
                            <Box
                                sx={{
                                    '& > legend': { mt: 2 },
                                }}
                            >
                                <Typography component="legend">Controlled</Typography>
                                <Rating
                                    name="simple-controlled"
                                    value={value}
                                    onChange={(event, newValue) => {
                                        setValue(newValue);
                                    }}
                                />
                                <Typography component="legend">Read only</Typography>
                                <Rating name="read-only" value={value} readOnly />
                                <Typography component="legend">Disabled</Typography>
                                <Rating name="disabled" value={value} disabled />
                                <Typography component="legend">No rating given</Typography>
                                <Rating name="no-value" value={null} />
                            </Box>
                            <h2>{dataCar[0].name}</h2>
                            <h4>{dataCar[0].price}</h4>
                        </div>
                    </div>

                </div>
            </Fragment>
        )
    }
}

export default CarSignleAudi1
